export default function getListStudents() {
  return [
    {
      id: 1,
      firstName: 'Guillaume',
      location: 'San Francisco',
    },
    {
      id: 2,
      firstName: 'James',
      location: 'Columbia',
    },
    {
      id: 3,
      firstName: 'Serena',
      location: 'San Francisco',
    },
  ];
}
